input = input.split(",")

def check(i, j):
    total = 0
    if i > 0: # check to the left
        if input[i-1][j] == "@":
            total+=1
        if j > 0:
            if input[i-1][j-1] == "@":
                total+=1
        if j < len(input[i])-1:
            if input[i-1][j+1] == "@":
                total+=1
    if i < len(input)-1:
        if input[i+1][j] == "@":
            total+=1
        if j > 0:
            if input[i+1][j-1] == "@":
                total+=1
        if j < len(input[i])-1:
            if input[i+1][j+1] == "@":
                total+=1
    if j > 0:
        if input[i][j-1] == "@":
            total+=1
    if j < len(input[i])-1:
        if input[i][j+1] == "@":
            total+=1
    
    if total < 4:
        return True
    return False

def part_one():
    total = 0
    for i in range(len(input)):
        for j in range(len(input[i])):
            if input[i][j] == "@":
                if check(i, j):
                    total+=1
    return total

def part_two():
    total = 0
    run = True
    run_count = 0
    while run:
        to_break = True
        to_remove = []
        for i in range(len(input)):
            for j in range(len(input[i])):
                if input[i][j] == "@":
                    if check(i, j):
                        total+=1
                        to_remove.append([i,j])
                        to_break = False
        for coor in to_remove:
            input[coor[0]] = input[coor[0]][:coor[1]] + "." + input[coor[0]][coor[1]+1:]
        if to_break:
            run = False
        run_count+=1
    return total
string = "1234"
print(string[:2])
print(string[2:])
def main():
    print(part_one())
    print(part_two())
main()